import React from "react";
function KeyButton({ keyName, CustomClass }) {
  console.log(keyName.split(" ").join(""))

  return (
    <>
      <button
        type="button"
        className={`py-2.5 px-5 me-2 mb-2 text-sm font-medium text-red-500 
                  focus:outline-none rounded-lg border border-gray-200 hover:bg-gray-100 
                hover:text-blue-700 focus:z-10 focus:ring-4 focus:ring-gray-100 
                dark:focus:ring-gray-700 dark:bg-gray-800 dark:text-gray-400 
                dark:border-gray-600 dark:hover:text-white dark:hover:bg-gray-700 ${CustomClass} ${keyName}`}
      >
        {keyName}
      </button>
    </>
  );
}

export default KeyButton;
